import React from 'react';
import {Link} from 'react-router-dom';

export default function Menu() {
    return (
        <div>
            <ul>
                <Link to="/"><li>HomePage</li></Link>
                <Link to="/first"><li>First</li></Link>
                <Link to="/second"><li>Second</li></Link>
            </ul>
        </div>
    )
}
